insert into Product values ('CSU_1001','KODAK Sport Single Use Camera','Single Use Cameras','Kodak','Waterproof up to 50 feet.

Divers and snorkelers, capture the vibrancy of life 50 feet underwater!

Rugged, durable, shock-proof rubber shell.

Great for bumpy rides and rocky trails. Roller Coaster anyone?

Sunscreen and scratch resistant lens.

No blurry pictures from sunscreen smudges. Avoid scratches from sand and snow that can ruin pictures.

Clearest, sharpest pictures!

Loaded with Kodak Ultra Max 800 speed film for clearer, sharper pictures than any underwater camera.

For outdoor and daylight use only.',1000,13.50,100,150,'');

insert into Product values ('CSU_1002','KODAK Single Use Wedding Camera / Ivory / 10-pack','Single Use Cameras','Kodak','Whether its the wedding reception, engagement party or bridal shower, your family and friends can enjoy capturing spontaneous candids with this wedding camera!
Unbeatable clarity

Loaded with Kodak 800 speed film for sharp pictures.
23% better pictures

compared to any 400 film speed camera.
Simple manual flash

with 4 to 11.5 foot flash range. Must charge before every picture.
Bulk wrapped

Each package contains 10 cameras -- not packaged individually.',850,49.90,100,150,'');

insert into Product values ('CBC_1001','Panasonic Lumix DMC-FZ18','Bridge Cameras','Panasonic','Wow – a photographic bazooka, thats what the FZ18 is. If your consideration when choosing a camera is how far and wide you can take its lens, your train has reached its final destination.

The astounding range of the FZ18s incredible Leica lens is 18x, with an equivalent of 28-504mm on a 35mm film camera. Thats summat else, by anyones standards. But the genius is that it doesnt physically result in a massive, shoulder-mounted cannon, but in a relatively small body with a lens that barely protrudes at either end of the zoom range.

Neither is the speed of the lens compromised, sitting, at its fastest end, at f2.8-4.2 – a wide enough aperture to minimise blur, when combined with the excellent image stabiliser.',700,410.00,100,150,'');

insert into Product values ('CBC_1002','Fujifilm Finepix S5700','Bridge Cameras','Fujifilm','Its the natural law of things that compact cameras are cheap, SLRs are expensive and bridge cameras, well, they bridge the gap in price as well as specs. But no one seems to have given Fujifilm a copy of the rule book.

For just over £100, the S5700 provides a chunky handful of a camera, with a 7.1MP sensor, a whopping 10x optical zoom and a 2.5in LCD. Thats a whole lot of tech for the price of an average compact.',750,150.00,100,150,'');

insert into Product values ('CBC_1003','Canon Powershot S3 IS','Bridge Cameras','Canon','Canon is no stranger to the super-zooming camera. The digicam giant can be regularly found at zoos, trying to get perfect shots of distant wildlife using its favourite Powershot. And now it’s ready to take its photography up a notch with this new 12x optical zoomer.       

The Powershot S3 IS has got a 6MP sensor, image stabiliser and all the photographic controls a keen photographer could want alongside a big-zooming lens. And it’s all squeezed into a package not much larger than an everyday compact.',400,220.00,100,150,'');

insert into Product values ('CRF_1001','Olympus 35-RC','Rangefinders','Olympus','The Olympus 35 RC is the smallest camera at the top of the page and the one with the best ergonomics.   Although the 35RC is essentially an entry level 35mm rangefinder camera, its metal body has a a superb fit and finish which is rarely scene on todays cameras.   In addition to being small, (a 35RC kit fits in a very svelte belt pouch), the 35 RC has a highly regarded, traditional ergonomic design common to larger 35mm cameras.   There are more advanced rangefinder cameras to choose from, but the Olympus 35RC captures the essense of 35 mm photography in a wonderfully executed compact package.',665,175.00,100,150,'');

insert into Product values ('CRF_1002','Olympus 35-RD','Rangefinders','Olympus','The more evolved Olympus 35 RD is a higher-specd derivative of the Olympus 35RC.   The purpose of the RD was to replace the well regarded 35SP in the Olympus line up.   Introduced in 1975, the 35RD was to be final compact 35mm rangefinder from Olympus to allow for a battery-free manual mode.   Electronics and plastic were poised to take over the market towards the end of the 1970s.',250,230.00,100,150,'');

insert into Product values ('CTL_1001','Rolleiflex 4.0 FW Film Camera','Twin Lens Reflex','Rolleiflex','Rollei remakes its legendary 6x6 cm twin-lens Rolleiflex wide angle camera! Equipped with a Schneider Kreuznach Super-Angulon 50mm f 4 HFT lens. Legendary best-sellers are making a come-back not only in music and fashion, but also in technical areas where classic products are likewise on the rise. The original wide angle Rolleiflex TLR camera which was discontinued in 1967 was once so popular with photographers. The new Rolleiflex Wide 4.0FW combines the classical twin-lens concept with todays operation comfort and high-end technology. It is the ideal camera for scenery and group shots. The leather parts are of brown cowhide with a crocodile grain. The back has chromium-plated edges that give the camera a sophisticated elegance. The logo on the front of the camera corresponds exactly to the one that adorned the Rolleiflex cameras of the thirties. The well-proven carrying strap eyelets of the earlier models have also been taken over.',340,320.00,100,150,'');

insert into Product values ('CTL_1002','Seagull Scientific Systems GC-107 Film Camera','Twin Lens Reflex','Seagull','Seagull 4A-105 and 4A-107 cameras are 120 twin lens reflex cameras. Their constructions, external forms and use are basicly the same. With the ly developed top cover, it is easier to close or open the waist viewfinder and much better to provent from dust. With the fresnel lens using in the viewfinder, cameras can offer brighter and sharper field of view. The camera is equipped with an accessory - Hot Shoe so that compact flasher is able to be used during picture taking. The construction of picture - taking lens for 4A-105 camera is 3 elements in 3 groups while it is 4 elements in 3 groups for 4A-107 camera. So 4A-107 is better than 4A-105 in imaging.',1000,345.00,100,150,'');

insert into Product values ('CSL_1001','Canon EOS 500D Digital SLR Camera','Single Lens Reflex','Canon','The EOS 500D sets your creativity free and lets you bring every side of your story to life with a choice of stunning 15.1 Megapixel resolution photos or pin-sharp Full High Definition video. Driven by the powerful DIGIC 4 processor this highly-featured model delivers many of the technologies developed for our professional models and matches them with intuitive design and controls so they are easy to access and apply. With High ISO, built-in flash, 3-inch Clear View LCD monitor and Live View Function the EOS 500D is ideal for taking superb shots and shooting great stories.',120,630.00,100,150,'');

insert into Product values ('CSL_1002','Nikon D3000 Digital SLR Camera','Single Lens Reflex','Nikon','The Nikon D3000 packs all the innovation and advanced engineering for which Nikon is famous into an easy-to-use SLR capable of incredible results. The D3000s new user-friendly interface and Intelligent Guide mode mean even first-time users can easily master the many new features and technologies inside the D3000s light, compact body and transform everyday scenes in to truly stunning picture.',130,470.00,100,150,'');

insert into Product values ('CSL_1003','Canon EOS 550D Digital SLR Camera','Single Lens Reflex','Canon','The powerful DIGIC 4 processor delivers many of the technologies developed for our professional models and matches them with intuitive design and controls so they are easy to access and apply. Features include an 18 Megapixel APS-C CMOS sensor, high ISO (expandable up to 12800) and iFCL-AE Metering
for better results in low and difficult lighting situations, 3-inch Clear View LCD monitor and Live View Function. The EOS 550D also incorporates dedicated support functions for the next-generation SDXC memory cards as well as Eye-Fi cards.',155,850.00,100,150,'');

insert into Product values ('CCL_1001','Fujifilm FinePix F200EXR','Compact Lens-Shutter Cameras','Fujifilm','As Fujifilm’s most advanced compact digital camera to date, the FinePix F200EXR is the worlds first production point-and-shoot digital camera to offer Fujifilm’s new Super CCD EXR sensor. The FinePix F200EXR’s sensor and color array generates high quality vivid images with its three selectable sensor modes such as Fine Capture Mode for high resolution, Pixel Fusion Mode for high sensitivity and low noise with ISO up to 12800, and Dual Capture Mode for wide dynamic range up to 800%.  The FinePix F200EXR also features an EXR Auto Mode, combining automatic scene recognition with automatic sensor mode selection.',420,379.99,100,150,'');

insert into Product values ('CCL_1002','Canon Powershot G11','Compact Lens-Shutter Cameras','Canon','New 10.0 Megapixel sensor coupled with Canons DIGIC 4 Image Processor designed as the High Sensitivity System for improved low light image performance.
	Full range of shooting and recording modes including RAW + JPEG for the ultimate creative control.
	Large, bright 2.8-inch Vari-angle LCD with 461,000 dots for shooting at a variety of angles plus an optical viewfinder.
	A host of optional accessories including Speedlite flashes, underwater housing and Tele-Converter Lens are available.
	A high-powered Wide-Angle 5x Optical Zoom (equivalent to 28 - 140mm) with Canons Optical Image Stabilizer gets you up close and personal to your subjects.
	DIGIC 4 Image Processor improves the overall camera performance.
	HDMI output for viewing still images on an HDTV.
	Improved Smart AUTO intelligently selects the proper setting for the camera based on 22 predefined shooting situations.',200,549.99,100,150,'');

insert into Product values ('CCL_1003','Panasonic Lumix FX580 BLACK','Compact Lens-Shutter Cameras','Panasonic','The new FX580 features a 3” touchscreen LCD, a 25mm ultra wide angle Leica DC lens, 5x optical zoom and 12.1 megapixels. With a dual control system using both touchscreen and joystick operation, its ability to record high definition (HD) video, the FX580 packs innovative and intuitive features, helping consumers enrich the digital photography experience.',175,449.99,100,150,'');


